import React, { useState, useEffect } from "react";
import $ from "jquery";
import RenderList from "./RenderList";

const List = () => {
  const [data, setdata] = useState([
    {
      id: "0",
      name: "John Doe",
      location: "Nairobi",
      about: "Way Down,We go",
      skill: "Masseuse",
      availability: "Available",
      image: "image",
    },
  ]);

  const [totalServers, settotalServers] = useState(0);

  useEffect(() => {
    getServices();
  }, [page]);
  const getServices = () => {
    $.ajax({
      url: `/profile?page=${page}`,
      type: "GET",
      dataType: "json",
      success: (result) => {
        setdata(result.service);
        settotalServers(result.total_services);
        return;
      },
      error: (error) => {
        alert("Unable to load data. Please try your request again");
        return;
      },
    });
  };
  return (
    <>
      <RenderList data={data} totalServers={totalServers} />
    </>
  );
};
export default List;
